// src/hooks/useArmouryData.js
import { useState, useEffect } from "react";

export default function useArmouryData(type) {
  const [data, setData] = useState([]);
  useEffect(() => {
    // Dummy data, replace with API call as needed
    const dataMap = {
      rifles: [
        { name: "AK-47", caliber: "7.62mm" },
        { name: "M4 Carbine", caliber: "5.56mm" },
      ],
      pistols: [
        { name: "Glock 17", caliber: "9mm" },
        { name: "Desert Eagle", caliber: ".50 AE" },
      ],
      protectionKits: [
        { name: "Kevlar Vest", protection: "Level IIIA" },
        { name: "Ballistic Helmet", protection: "Level IIIA" },
      ],
      rpgBazuka: [
        { name: "RPG-7", caliber: "40mm" },
        { name: "Bazooka M1", caliber: "60mm" },
      ],
    };
    setData(dataMap[type] || []);
  }, [type]);
  return data;
}
